----other queries

----contests
select we.id as entry_id, wa.title, wa.id as activation_id, wa.starttime_iso, wa.endtime_iso, wa.type, we.email, we.firstname, 
    we.lastname, zip.value as zip, zip.county, zip.state, zip.hma_ind, we.enteredat_iso, we.emailoptin, sms.sms_opt_in, sponsor.sponsor_opt_in,
    (case when psl.psl_owner = 1 then 1 else 0 end) as psl_owner, 
    (case when sgb.sg_buyer = 1 then 1 else 0 end) as sgb_attendee, 
    retail.val as retail_spend, retail.order_count as num_retail_orders, 
    db_data.helix_source,
    dt.gender_prsn, dt.age_rng_prsn, dt.adv_hh_marital_status, dt.adv_target_income_2, 
    dt.target_net_worth_2, dt.occupation, dt.adv_hh_education, dt.niches_3, 
    dt.hh_type_family_comp
    from custom.wit_entries we
    join custom.wit_activations wa on wa.id = we.activationid 
    left join (select we.entryid, max(case 
        when we.name like '%SMS%' and we.value = '1' then 1 
        when we.name like '%text%' and we.value = '1' then 1  
        else 0
    end) as sms_opt_in from custom.wit_extras we where we.name like '%SMS%' or 
    we.name like '%text%' group by we.entryid) sms on we.id = sms.entryid 
    left join (select distinct (we.entryid) as e_id,
    (case when we.value = 1 or we.value = 'Yes' then 1 else 0 end) as sponsor_opt_in from custom.wit_extras we 
    left join custom.wit_activations wa on wa.id = we.activationid 
    where wa.sponsor_name <> '' and lower(we."name") like '%shar%'
    or we."name" like '%I agree to receive commercial emails from Southwest Airlines%') sponsor on we.id = sponsor.e_id 
    left join (	select * from custom.wit_extras we2 
	left join (select zd.zip, zd.county, zd.state, zd.hma_ind from custom.zipcode_db zd) zd on substring(we2.value, 1, 5) = right('0'+cast(zd.zip as varchar(5)), 5)
	where lower(we2."name") like '%zip%' or we2.name like '%Postal%'
    group by we2.activationid, we2.entryid, we2.name, we2.value, zd.zip, zd.county, zd.state, zd.hma_ind) zip
        on we.id = zip.entryid
    left join (select g.gr_id, g.email, (case when t.tag_name = 'psl-owners-2024' then 1 else 0 end) as psl_owner from custom_2.vw_seatgeek_gameday_ticketing vsgt 
    left join (select * from helix.mappings m where m.helix_source = 'seatgeek') m on m.helix_sourceid = vsgt.attended_crmid
    left join helix.grrecords g on m.gr_id = g.gr_id
    join helix.tags t on g.gr_id = t.gr_id 
    where t.tag_name = 'psl-owners-2024' and 
    g.gr_id not in (
    select t.gr_id from helix.tags t where t.tag_name in ('brokers')) and vsgt.price_type_group <> 'Complimentary'
    ) psl on lower(psl.email) = lower(we.email) -- good
    left join (select distinct (lower(g.email)) as email, (case when vsgt.scan_date is not null then 1 else 0 end) as sg_buyer from custom_2.vw_seatgeek_gameday_ticketing vsgt 
	left join (select * from helix.mappings m where m.helix_source = 'seatgeek') m on m.helix_sourceid = vsgt.attended_crmid
 	left join helix.grrecords g on m.gr_id = g.gr_id
 	where g.gr_id not in (select t.gr_id from helix.tags t where t.tag_name = 'psl-owners-2024')
	and vsgt.show_type in ('2024 Home Season', '2024 Playoff Tickets')
	and vsgt.price_type_group <> 'Complimentary'
    ) sgb on lower(sgb.email) = lower(we.email) --updated i think
    left join (select t.client_email, count(distinct(t.order_id)) as order_count, 
    sum(t.unit_price*t.qty_sold) as val from fanatics_online."transaction" t 
    where date_part(y, t.processed_date) >= 2024 
    group by t.client_email) retail on lower(we.email) = lower(retail.client_email)
    left join (select * from (select g.gr_id, lower(g.email) as email, m.helix_source, m.processed_date, 
    row_number() over (partition by lower(g.email) order by m.processed_date) as row_num
    from helix.mappings m
    join helix.grrecords g on g.gr_id = m.gr_id 
    order by lower(g.email)) where row_num = 1) db_data on lower(we.email) = lower(db_data.email)
    left join nfl_import.fan_unified fu on lower(fu.email_addr) = lower(we.email)
    left join nfl_import.demographic_tsp dt on fu.nfl_fan_id = dt.nfl_fan_id
    where wa.starttime_iso >= '%2024-02-01' and wa.starttime_iso < '%2025-02-01%'
    
----ticket revenue by country
select distinct (fu.country), sum(fu.tix_prim_sth_rev_36mo) as revsth, sum(fu.tix_prim_sth_qty_36mo) as purchsth, sum(fu.tix_prim_sgl_rev_36mo) as revsgl_prim,
sum(fu.tix_prim_sgl_qty_36mo) purchsgl_prim, sum(fu.tix_sec_sgl_rev_36mo) as revsgl_sec, sum( fu.tix_sec_sgl_qty_36mo) as purchsgl_sec from nfl_import.fan_unified fu 
group by fu.country

----with clause query
with ice_fest as (select s.purch_client_guid, s.primary_ticket_id, c.crm_id,
	(case when c.crm_id in (select m.helix_sourceid from helix.tags t
	left join helix.mappings m on m.gr_id = t.gr_id
	where t.tag_name = 'psl-owners-2024' and m.helix_source = 'seatgeek') then 1 else 0 end) as psl_owner,
	(case when a.barcode_usage_id is null then 0 else 1 end) as attended_ind
	from seatgeek2_balravens.sales s
	left join seatgeek2_balravens.clients c on c.client_id = s.purch_client_guid
	left join helix.mappings m on m.helix_sourceid = c.crm_id
	left join seatgeek2_balravens.attendance a on a.primary_ticket_id = s.primary_ticket_id
	where s.product_id in ('ecf0d2d7-1bca-ef11-84e8-89c21cbd1f25', '0916b081-5b00-46e2-8cc3-e716fd2578ea')
	and s.current_status = 1 and m.helix_source = 'seatgeek')
	select count(distinct(ice_fest.purch_client_guid)) from ice_fest
	where ice_fest.psl_owner = 1   

