left join seatgeek2_balravens.clients c on c.client_id = s.purch_client_guid 
left join helix.mappings m on c.crm_id = m.helix_sourceid
left join helix.grrecords g on g.gr_id = m.gr_id 
left join (select distinct (c.crm_id), sum(s.total_payment) as t_spend from seatgeek2_balravens.sales s
	left join seatgeek2_balravens.events e on e.product_id = s.product_id
	left join seatgeek2_balravens.clients c on c.client_id = s.purch_client_guid 
	where e.show_type in ('2024 Home Season', '2024 Playoff Tickets')
	group by c.crm_id) as tix_spend on tix_spend.crm_id = m.helix_sourceid 
