----nfl uvof acq sources
select distinct(nuos.src_nm), count(*) from helix.grrecords g
	left join (select m.gr_id, m.helix_sourceid, m.helix_source, a.source_created_on as create_date, pg_catalog.row_number()
	OVER(
         PARTITION BY m.gr_id
         ORDER BY a.source_created_on) AS map_order
    from helix.mappings m
	join helix.allsources a on a.id = m.helix_sourceid) a on g.gr_id = a.gr_id
	left join custom_3.nfl_uvof_origin_source nuos on nuos.cust_id = a.helix_sourceid
	where a.map_order = 1 and g.source_created_on >= '2024-02-01' and a.helix_source = 'nfl-uvof'
	group by nuos.src_nm
    
